    "sort"
)

func MoveOneBall(arr []int) bool {
    n := len(arr)
    if n == 0 {
        return true
    }

    // Find the index of the minimum element
    minIndex := 0
    for i := 1; i < n; i++ {
        if arr[i] < arr[minIndex] {
            minIndex = i
        }
    }

    // Check if array is sorted starting from minIndex
    for i := 0; i < n-1; i++ {
        if arr[(minIndex+i)%n] > arr[(minIndex+i+1)%n] {
            return false
        }
    }

    return true
}

